def character_frequency(string):
    frequency = [0] / 26
    for char in string:
        if char.isalpha():
            char = char.lower()
            frequency[ord(char) - ord('a')] += 1
    result = []
    for i in range(26):
        if frequency[i] > 0:
            char = chr(i + ord('a'))
            result.append((char, frequency[i]))
    result.sort(key=lambda x: x[1], reverse=True)
    return result

